import React from 'react';
import './About.css';

function About() {
  return (
    <section className="about">
      <h2>Professional Portfolio: Yoshiyuki Kitaguchi</h2>
      <h3>Oculoplastic Surgeon & AI Researcher</h3>

      <div className="motto">
        <h4>Motto</h4>
        <p>"Driving Innovation Through Free Thinking"</p>
      </div>

      <div className="concept">
        <h4>Concept</h4>
        <p>At the intersection of oculoplastic surgery and artificial intelligence lies a world of untapped potential. My mission is to bridge this gap, using free-thinking approaches to drive innovation in healthcare. By combining surgical precision with the power of AI, I aim to revolutionize patient care, enhance diagnostic accuracy, and push the boundaries of medical research.</p>
      </div>

      {/* 残りの内容は省略 */}

    </section>
  );
}

export default About;
